<!DOCTYPE html>
<html>
<head>
    <title>顔面偏差値チェッカー</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            text-align: center;
        }
        h1 {
            margin-bottom: 20px;
        }
        #imageInput {
            display: none;
        }
        label {
            background-color: #007BFF;
            color: #fff;
            padding: 10px 20px;
            cursor: pointer;
            border-radius: 5px;
        }
        button {
            background-color: #007BFF;
            color: #fff;
            padding: 10px 20px;
            border: none;
            border-radius: 5px;
            margin-top: 10px;
            cursor: pointer;
        }
        .image-container {
            display: flex;
            flex-direction: column;
            align-items: center;
        }
        img {
            max-width: 50%;
            margin-top: 15px;
        }
        #share-button {
            background-color: #1DA1F2;
            color: #fff;
            padding: 10px 20px;
            border: none;
            border-radius: 5px;
            margin-top: 10px;
            cursor: pointer;
        }
    </style>
</head>
<body>
    <h1>顔面偏差値チェッカー</h1>
    <input type="file" id="imageInput" accept="image/*">
    <label for="imageInput">画像を選択</label><br>
    <button onclick="checkFaceScore()">評価する</button>
    <div id="result"></div>
    <div class="image-container">
        <img id="imagePreview" style="display: none;">
    </div>
    <button id="share-button" style="display: none;" onclick="shareOnTwitter()">Twitterでシェア</button>
